import {Button, Image} from "react-bootstrap";
import "../css/header.css";
import $ from 'jquery';
import { ReactComponent as Logo } from "../../svg/needlog.svg";
import Menu from "../../svg/menu.svg";

function Header({filter}) {
    function openFilter() {
        let filter = $('#filter');
        let value = filter.css('display') === 'none' ? 'block' : 'none';

        filter.css('display', value);
    }

    function print() {
        filter.forEach(c => console.log(c));
    }

    return (
        <div className="header">
            <div className="left">
                <Logo id="logo"/>
            </div>
            <div>
                <Button onClick={print}>test</Button>
            </div>
            <div className="right">
                <Button>
                    <Image id="menu" src={Menu} alt="메뉴이미지" onClick={openFilter}/>
                </Button>
            </div>
        </div>
    )
}

export default Header;
